import React, { useState, useEffect } from 'react';
import { motion } from 'framer-motion';


import './About.scss';
const abouts =[
  {title: 'web Development',description: 'I am good web developer.', imgUrl: ''},
  {title: 'web Design',description: 'I am good web developer.', imgUrl: ''},
  {title: 'UI?UX',description: 'I am good web developer.', imgUrl: ''},
  {title: 'web Animation',description: 'I am good web developer.', imgUrl: ''}
];

const About = () => {
  return (
    <>
      <h2 className="head-text">I Know that
       <span>Good Design</span> <br />means 
        <span>Good Business</span></h2>
       
</>
      )
    }
    export default About;
